import { Link } from 'react-router-dom'

export default function Main() {
  return (
    <main className='home--main'>
        <h1 className='title'>ILLUMZ</h1>
        <h3 className='description'>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the
         1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</h3>
         <Link className = 'text-link' to = {'/createaccount'}><button className='get--started'>Get started</button></Link>
    </main>
  )
}
